@import "./reset.scss";

$break-small: 320px;
$break-medium: 700px;
$break-large: 1200px;

.card {
  margin: 0 auto;
  margin-top: 2vh;
  border-radius: 50px;
  width: 96vw;
  height: 96vh;
  overflow: hidden;
  border: 1px solid;
  background: #000000; /* fallback for old browsers */
  background: -webkit-linear-gradient(
    to right,
    #000000,
    #434343
  ); /* Chrome 10-25, Safari 5.1-6 */
  background: linear-gradient(to right, #000000, #434343);

  h1 {
    color: white;
    text-align: center;
    text-transform: uppercase;
    font-size: 60px;
    margin-top: 3%;
    font-family: "Baloo 2", cursive;
    font-weight: 600;
    @media screen and (min-width: $break-small) and (max-width: 699px) {
      font-size: 20px;
    }
    @media screen and (min-width: $break-medium) and (max-width: $break-large) {
      font-size: 40px;
    }
  }

  h2 {
    text-align: right;
    color: white;
    text-transform: uppercase;
    font-size: 50px;
    margin-top: 3%;
    margin-right: 5%;
    font-family: "Baloo 2", cursive;
    font-weight: 600;
    @media screen and (min-width: $break-small) and (max-width: 699px) {
      font-size: 20px;
    }
    @media screen and (min-width: $break-medium) and (max-width: $break-large) {
      font-size: 40px;
    }
  }

  img {
    width: 150px;
    height: 100px;
    margin-left: 10%;
    @media screen and (min-width: $break-small) and (max-width: 699px) {
      width: 100px;
      height: 50px;
    }
    @media screen and (min-width: $break-medium) and (max-width: $break-large) {
      width: 120px;
      height: 70px;
    }
  }

  .date {
    input {
      background-color: transparent;
      border: none;
      margin: 2% 10% 0 10%;
      width: 80%;
      height: 20vh;
      color: white;
      font-size: 100px;
      margin-bottom: 1%;
      @media screen and (min-width: $break-small) and (max-width: 699px) {
        font-size: 25px;
      }
      @media screen and (min-width: $break-medium) and (max-width: $break-large) {
        font-size: 50px;
      }

      &::-webkit-outer-spin-button,
      &::-webkit-inner-spin-button {
        -webkit-appearance: none;
        margin: 0;
      }

      &::placeholder {
        font-family: "Baloo 2", cursive;
        font-size: 100px;
        text-align: center;
        color: lightgray;
        @media screen and (min-width: $break-small) and (max-width: 699px) {
          font-size: 25px;
        }
        @media screen and (min-width: $break-medium) and (max-width: $break-large) {
          font-size: 50px;
        }
      }
    }

    p {
      font-family: "Baloo 2", cursive;
      text-align: center;
      color: white;
      font-weight: 500;
    }
    .month {
      color: lightgray;
      font-size: 15px;
      @media screen and (min-width: $break-small) and (max-width: 699px) {
        font-size: 10px;
      }
      @media screen and (min-width: $break-medium) and (max-width: $break-large) {
        font-size: 15px;
      }
    }
    .day {
      font-size: 60px;
      @media screen and (min-width: $break-small) and (max-width: 699px) {
        font-size: 30px;
      }
      @media screen and (min-width: $break-medium) and (max-width: $break-large) {
        font-size: 40px;
      }
    }
  }

  .flex-container {
    display: flex;
    flex-direction: row;
    justify-content: space-around;

    h3 {
      color: white;
      font-size: 60px;
      font-family: "Baloo 2", cursive;
      font-weight: 500;
      @media screen and (min-width: $break-small) and (max-width: 699px) {
        font-size: 20px;
      }
      @media screen and (min-width: $break-medium) and (max-width: $break-large) {
        font-size: 40px;
      }
    }
    .logo {
      width: 300px;
      height: 120px;
      margin-top: -1%;

      @media screen and (min-width: $break-small) and (max-width: 699px) {
        width: 160px;
        height: 100px;
      }
      @media screen and (min-width: $break-medium) and (max-width: $break-large) {
        font-size: 40px;
      }
    }
  }
}
